import React from "react";

const Login = () =>{

    const [error, setError]= useState("");

    return(
        <div>
            Login to get started!<br/><br/>
            <div>
                Email<br/>
                <input type="email"/>
            </div>
            <div>
                Password<br/>
                <input type="password"/>
            </div>
            {
                error && <p>{error}</p> 
            }
            <input type="button" value="Login"/>
        </div>
    )
}

export default Login;
